// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './components/homepage';  // Importing the HomePage component

// Defining some placeholder components for the other pages
const ServiceRequestPage = () => <h2>Service Request Page</h2>;
const ProblemManagementPage = () => <h2>Problem Management Page</h2>;
const IncidentManagementPage = () => <h2>Incident Management Page</h2>;
const ChangeManagementPage = () => <h2>Change Management Page</h2>;

const App = () => {
  return (
    <Router>
      <Switch>
        {/* Define routes for each of the pages */}
        <Route exact path="/" component={HomePage} />
        <Route path="/service-request" component={ServiceRequestPage} />
        <Route path="/problem-management" component={ProblemManagementPage} />
        <Route path="/incident-management" component={IncidentManagementPage} />
        <Route path="/change-management" component={ChangeManagementPage} />
      </Switch>
    </Router>
  );
};

export default App;
